import React from 'react';
import PropTypes from 'prop-types';
import {graphql} from 'react-apollo';
import gql from 'graphql-tag';

const Contacts = (props) => {
    console.log(props);
    return (
        <div>Contacts</div>
    );
};

const query = gql`
    {
        contacts {
            name
        }
    }
`;

export default graphql(query)(Contacts);
